import React from "react"

class Register extends React.Component{
    constructor(){
        super()
        this.state = {
            firstName:"",
            lastName:"",
            email:"",
            password:"",
            isStudent: true
        }
        this.handleChange = this.handleChange.bind(this)
    }
    handleChange(event){
        console.log(this.state);
        this.setState(prevState =>{
            return {
                isStudent: !prevState.isStudent
            }
        }); console.log(this.state)
    }
    render(){
        return(
            <form>
                <label> Username:
                    <input placeholder="userName"/>
                </label>
                <br/>
                <label> Password:
                    <input placeholder="password"/>
                </label>
                <br/>
                <label> Email:
                    <input placeholder="email"/>
                </label>
                <br/>
                <label> Student:
                    <input type="radio" name="status" value="student" checked={this.state.isStudent === true} onChange={this.handleChange}/>
                </label>
                <label> Tutor:
                    <input type="radio" name="status" value="tutor" checked={this.state.isStudent === false} onChange={this.handleChange}/>
                </label>

            </form>
        )
    }
}

export default Register;
